function Background() {
  return (
    <>
      <SunSVG className="sun-svg" style={{ top: '120px', left: '150px' }} />
      <CloudSVG className="cloud-svg" style={{ top: '120px', left: '150px' }} />
      <CloudSVG className="cloud-svg" style={{ top: '80px', right: '250px' }} />
      <CloudSVG className="cloud-svg" style={{ top: '120px', left: '150px' }} />
      <CloudSVG className="cloud-svg" style={{ top: '80px', right: '250px' }} />
    </>
  );
}

export default Background;
